import React, { useState } from 'react';
import Footer from './Components/Footer'
import Box from './Components/Box'
import Header from './Components/Header'
//import ContactPage from './Pages/Contact/ContactPage'



function App() {

  const [activeTag, setActiveTag] = useState("");
  const tabs = ['About', 'Resources', 'Events', 'Subsidiaries', 'Contact'];
  let text = '';
  const head = "We love hearing from you!";
  let body = 'Tech Talks are a great way to get Rice students interested in what your company does and get in contact with potential interns and employees. If you are interested in hosting one of these, please email our current President Luis Clague. Please be ready to provide a preferred date, time, and duration.'


  return (
    <div>
      <Header 
              activeTag={activeTag}
              setActiveTag={setActiveTag}
              tabs={tabs}
              text={text}/>
      <div className="flex text-gray-500 text-5xl font-extrabold justify-center">{head}</div>
      <p className="flex justify-center">If you need to contact club leadership, email us here.</p>
      <Box title={"Tech Talks"} body={body}/>
      <Footer/>
    </div>
  );
}

export default App;
